import React from 'react';
import { Link } from 'react-router-dom'; // Import Link for routing
import img1 from './Image/vid1.jpg'; // Image for Machine 1
import img2 from './Image/m1.jpeg';  // Image for Machine 2
import img3 from './Image/vid2.jpg';  // Image for Machine 3
import img4 from './Image/2.jpg';  // Image for Machine 4
import img5 from './Image/1.jpg'; //5


function Card() {
  return (
    <div className='card-container'>
      {/* Card 1 */}
      <div className="card" >
        <img src={img1} className="card-img-top" alt="Machine 1" />
        <div className="card-body">
          <h5 className="card-title">Machine 1</h5>
          <p className="card-text">This is Machine 1. It is designed for high performance and durability.</p>
          <Link to="/page" className="btn btn-primary">Go to Page</Link>
        </div>
      </div>

      {/* Card 2 */}
      <div className="card" >
        <img src={img2} className="card-img-top" alt="Machine 2" />
        <div className="card-body">
          <h5 className="card-title">Machine 2</h5>
          <p className="card-text">Machine 2 offers innovative solutions for complex tasks.</p>
          <Link to="/page" className="btn btn-primary">Go to Page</Link>
        </div>
      </div>

      {/* Card 3 */}
      <div className="card">
        <img src={img3} className="card-img-top" alt="Machine 3" />
        <div className="card-body">
          <h5 className="card-title">Machine 3</h5>
          <p className="card-text">Discover the power and efficiency of Machine 3.</p>
          <Link to="/page" className="btn btn-primary">Go to Page</Link>
        </div>
      </div>

      {/* Card 4 */}
      <div className="card">
        <img src={img4} className="card-img-top" alt="Machine 3" />
        <div className="card-body">
          <h5 className="card-title">Machine 3</h5>
          <p className="card-text">Discover the power and efficiency of Machine 3.</p>
          <Link to="/page" className="btn btn-primary">Go to Page</Link>
        </div>


        {/* Card 5 */}
      <div className="card">
        <img src={img5} className="card-img-top" alt="Machine 3" />
        <div className="card-body">
          <h5 className="card-title">Machine 3</h5>
          <p className="card-text">Discover the power and efficiency of Machine 3.</p>
          <Link to="/page" className="btn btn-primary">Go to Page</Link>
        </div>
      </div>
      </div>
      <div className="card">
         <img src={img} className="card-img-top" alt="Machine" />
         <div className="card-body">
           <h5 className="card-title">A Machine</h5>
           <p className="card-text">This is a brief description of the machine.</p>
           <Link to="/page" className="btn btn-primary">Go to Page</Link>
         </div>
      </div>
    </div>
  );
}

export default Card;
